  beforeEach(async () => {
    await TestBed.configureTestingModule({
      declarations: [ WordSearchComponent ]
    })
    .compileComponents();

    fixture = TestBed.createComponent(WordSearchComponent);
    component = fixture.componentInstance;
    fixture.detectChanges();
  });

